import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';

const Exercise = props => (
    <tr>
        <td>{props.exercise.username}</td>
        <td>{props.exercise.description}</td>
        <td>{props.exercise.duration}</td>
        <td>{props.persontoheal.first}</td>
        <td>{props.persontoheal.last}</td>
        <td>{props.persontoheal.gender}</td>
        <td>{props.persontoheal.age}</td>
        <td>{props.persontoheal.city}</td>
        <td>{props.persontoheal.stateRegion}</td>
        <td>{props.persontoheal.country}</td>
        <td>{props.persontoheal.yourName}</td>
        <td>{props.persontoheal.email}</td>
        <td>{props.persontoheal.condition}</td>
        <td>{props.persontoheal.date}</td>
        <td>{props.persontoheal.profile}</td>

        <td><Link to={"/edit/"+props.exercise._id}>edit</Link> | <a href="#" onClick={() => { props.deleteExercise(props.exercise._id) }}>delete</a>
        </td>
    </tr>
)

class ExerciseList extends Component {
    constructor(props) {
        super(props);

        this.deleteExercise = this.deleteExercise.bind(this);

        this.state = {exercises: []};
    }
        componentDidMount() {
            axios.get('http://localhost:5000/exercises/')
            .then(response => {
                this.setState ({ exercises: response.data })
            })
            .catch((error) => {
                console.log(error);
            })
        }

        deleteExercise(id) {
            axios.delete('http://localhost:5000/exercises/' +id)
            .then(res => console.log(res.data));

            this.setState({
                exercises: this.state.exercises.filter(el => el._id !== id)
            })
        }

        exerciseList() {
            return this.state.exercises.map(currentexercise => {
                return <Exercise exercise={currentexercise} deleteExercise={this.deleteExercise} key={currentexercise._id} />;
            })
        }
    render() {
        return (
            <div>
                <h3>Logged Exercises</h3>
                <table className="table">
                    <thead className="thead-light">
                        <tr>
                            <th>Username</th>
                            <th>Description</th>
                            <th>Duration</th>
                            <th>First</th>
                            <th>Last</th>
                            <th>Gender</th>
                            <th>Age</th>
                            <th>City</th>
                            <th>State / Region</th>
                            <th>Country</th>
                            <th>Your Name</th>
                            <th>Email</th>
                            <th>Condition</th>
                            <th>Date</th>
                            <th>Profile</th>
                        </tr>
                    </thead>
                    <tbody>
                        { this.exerciseList() }
                    </tbody>
                </table>
            </div>
        )
    }
}

export default ExerciseList;
